// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract SupplyChain {
    // State variables
    address public manufacturer;
    ProductVerification public productVerification;

    struct Product {
        uint id;
        string name;
        string serial;
        string brand;
        uint price;
        address manufacturer;
        address owner;
        address[] transactionHistory;
        bool isAuthentic;
    }

    struct Seller {
        string name;
        string code;
        address manufacturerId;
        string brand;
        string phoneNumber;
        address sellerAddress;
    }

    mapping(uint => Product) public products;
    mapping(address => bool) public isSeller;
    mapping(address => Seller) public sellers;

    // Events
    event SellerAdded(address indexed seller);
    event ProductAdded(uint indexed id, string name, string serial, string brand, uint price, address indexed manufacturer, address indexed owner);
    event ProductTransferred(uint indexed id, address indexed from, address indexed to);

    // Modifiers
    modifier onlyManufacturer() {
        require(msg.sender == manufacturer, "Only the manufacturer can call this function");
        _;
    }

    modifier onlySeller() {
        require(isSeller[msg.sender], "Only registered sellers can call this function");
        _;
    }

    // Constructor
    constructor(address _productVerificationAddress) {
        manufacturer = msg.sender;
        productVerification = ProductVerification(_productVerificationAddress);
    }

    // Function to add a seller
    function addSeller(
        string memory _name,
        string memory _code,
        address _manufacturerId,
        string memory _brand,
        string memory _phoneNumber,
        address _sellerAddress
    ) public onlyManufacturer {
        require(_manufacturerId == manufacturer, "Invalid manufacturer ID");
        require(!isSeller[_sellerAddress], "Seller already exists");

        Seller memory newSeller = Seller(_name, _code, _manufacturerId, _brand, _phoneNumber, _sellerAddress);
        sellers[_sellerAddress] = newSeller;
        isSeller[_sellerAddress] = true;

        emit SellerAdded(_sellerAddress);
    }

    // Function to add a product
    function addProduct(string memory _name, string memory _serial, string memory _brand, uint _price, address _owner) public onlyManufacturer {
        uint productId = uint(keccak256(abi.encodePacked(block.timestamp, _serial)));
        products[productId] = Product(productId, _name, _serial, _brand, _price, manufacturer, _owner, new address[](0), false);
        emit ProductAdded(productId, _name, _serial, _brand, _price, manufacturer, _owner);
    }

    // Function to transfer a product
    function transferProduct(uint _productId, address _to) public {
        Product storage product = products[_productId];
        require(isSeller[msg.sender], "Only registered sellers can transfer products");
        require(product.owner == msg.sender, "You are not the owner of this product");

        product.owner = _to;
        product.transactionHistory.push(_to);
        emit ProductTransferred(_productId, msg.sender, _to);
    }

    // Function to sell a product to a seller (requires details based on considerations above)
    function sellProductToSeller(uint256 productSN, address payable sellerAddress) public payable onlyManufacturer {
        // Implement logic based on requirements
    }
}

contract ProductVerification {

    // Mapping to store valid product details
    mapping(uint256 => Product) public products;

    struct Product {
        uint256 serialNumber;
        string consumerCode;
        bool isAuthentic;
    }

    // Event to log product addition
    event ProductAdded(uint256 serialNumber, string consumerCode, bool isAuthentic);

    // Function to add a valid product
    function addProduct(uint256 _productSN, string memory _consumerCode) public {
        require(products[_productSN].serialNumber == 0, "Product with this serial number already exists");

        products[_productSN] = Product(_productSN, _consumerCode, false);

        emit ProductAdded(_productSN, _consumerCode, false);
    }

    // Function to set product authenticity
    function setAuthenticity(uint256 _productSN, bool _isAuthentic) public {
        Product storage product = products[_productSN];
        require(product.serialNumber != 0, "Product with this serial number does not exist");

        product.isAuthentic = _isAuthentic;
    }

    // Function to verify product authenticity
    function verifyProduct(uint256 _productSN, string memory _consumerCode) public view returns (bool) {
        Product memory product = products[_productSN];
        return product.serialNumber == _productSN && keccak256(abi.encodePacked(product.consumerCode)) == keccak256(abi.encodePacked(_consumerCode)) && product.isAuthentic;
    }
}

contract Consumer {

    ProductVerification public productVerification;

    // Event to log product verification status
    event ProductVerified(uint256 productSN, string status);

    // Constructor
    constructor(address _productVerificationAddress) {
        productVerification = ProductVerification(_productVerificationAddress);
    }

    // Function to verify product status
    function verifyProductStatus(uint256 _productSN, string memory _consumerCode) public {
        bool isAuthentic = productVerification.verifyProduct(_productSN, _consumerCode);

        string memory status = isAuthentic ? "REAL" : "FAKE";

        emit ProductVerified(_productSN, status);
    }
}
